Fascinating Animals: Kodiak Bear
aka Faszinierende Tierwelten: Kodiakbaren
This unique wildlife film brings you to one of the most remote places on earth to meet the Kodiak Bear (Ursus Arctos Middendorffi), the world's largest land predator. Kodiak Island in the Gulf of Alaska, in the North Pacific Ocean, is home to the largest bear on earth. At least 2,500 bears live on the island and the animal is regarded as the world's biggest land predator, reaching an impressive four meters in height when standing on its hind legs. Known as Alaska's Emerald Isle, Kodiak Island provides a wealth of spectacular geographic features and habitats within a surprisingly small area. High mountains and valleys of thick brush have protected Kodiak's wildlife for centuries, and the isolated location has kept the progress of civilisation at a distance. Wildlife abounds, from the majestic bald eagle to the amazing sockeye salmon, which swims thousands of miles back to its Kodiak birthplace to spawn... and die. Film maker Stefan Quinth spent three years filming the Kodiak Bear and the wildlife of Kodiak Island. His film is a dramatic story about bear and salmon, beavers and eagles. But it is also a film about the thrill of meeting the giant bear eye to eye in its natural habitat.

